import React from "react";
import { BrowserRouter as Router, Route} from "react-router-dom";
import AccountVerificationScreen from "./AccountVerificationScreen"; // Import your component
import OTPScreen from "./OTPScreen"; // Import other components as needed
import HomeScreen from "../navigations/HomeScreen"; // Import other components as needed

function App() {
  return (
    <Router>
      <Switch>
        {/* Define routes */}
        <Route path="/AccountVerificationScreen" component={AccountVerificationScreen} />
        <Route path="/OTP" component={OTPScreen} />
        <Route path="/home" component={HomeScreen} />
        {/* Add more routes as needed */}
      </Switch>
    </Router>
  );
}

export default App;
